import React from 'react';
import SignIn from './components/SignIn';
import Header from './components/Header';
import './App.css';

class App extends React.Component{
  constructor(props){
    super(props);
  }
  render () {
    return (
      <div className="App">
        <Header />
        <SignIn />
      </div>
    );
  }
}

export default App;
